	[script]
	id="cave_monologue"
		[modification]
		on_process="[
if(not('enter_abandoned_mines' in vars.triggered_events), [
	set(vars.triggered_events, vars.triggered_events + ['enter_abandoned_mines']),
	set(level.zoom, 2),
	speech_dialog(self, [~The abandoned mines, at last!~]),
	speech_dialog(self, [~I can't wait to leave this~, ~forest and those annoying~, ~bouncy bugs behind.~]),
	set(level.zoom, 1)
]),
end_script()
]"
		target="level.player"
		[/modification]

	[/script]

	[script]
	id="switch_monologue"
		[modification]
		on_process="[
if(not('enter_abandoned_mines' in vars.triggered_events),
	speech_dialog(self, [~A switch puzzle?~], [~Why did it have to be a switch puzzle?~])
),
end_script()
]"
		target="level.player"
		[/modification]

	[/script]

	[script]
	id="triple_switch_init"
		[modification]
		on_process="[
if(vars.bon_bosque_switch_A, set(switch.animation, 'pushed') where switch = get_object(level, 'switchA')),
if(vars.bon_bosque_switch_B, set(switch.animation, 'pushed') where switch = get_object(level, 'switchB')),
if(vars.bon_bosque_switch_C, set(switch.animation, 'pushed') where switch = get_object(level, 'switchC')),
begin_script('triple_switch_logic')
]"
		target="level.player"
		[/modification]

	[/script]

	[script]
	id="triple_switch_logic"
		[modification]
		on_process="[
if(vars.bon_bosque_switch_A and vars.bon_bosque_switch_B and vars.bon_bosque_switch_C,
	map(['control_post_door', 'control_post_door_2', 'door1', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
),
if((not vars.bon_bosque_switch_A) and (not vars.bon_bosque_switch_B) and (not vars.bon_bosque_switch_C), [
	fire_event(get_object(level, 'control_post_door'), 'unlock'),
	map(['control_post_door_2', 'door1', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
]),
if((not vars.bon_bosque_switch_A) and vars.bon_bosque_switch_B and (not vars.bon_bosque_switch_C), [
	map(['control_post_door', 'door1'], 'door_id', fire_event(get_object(level, door_id), 'unlock')),
	map(['control_post_door_2', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
]),
if((not vars.bon_bosque_switch_A) and vars.bon_bosque_switch_B and vars.bon_bosque_switch_C, [
	map(['control_post_door_2', 'control_post_door'], 'door_id', fire_event(get_object(level, door_id), 'unlock')),
	map(['door1', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
]),
if(vars.bon_bosque_switch_A and (not vars.bon_bosque_switch_B) and vars.bon_bosque_switch_C, [
	map(['control_post_door', 'control_post_door_2'], 'door_id', fire_event(get_object(level, door_id), 'lock')),
	map(['door1', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'unlock'))
]),
if(vars.bon_bosque_switch_A and vars.bon_bosque_switch_B and (not vars.bon_bosque_switch_C), [
	fire_event(get_object(level, 'control_post_door_2'), 'lock'),
	map(['control_post_door', 'door1', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'unlock'))
]),
if((not vars.bon_bosque_switch_A) and (not vars.bon_bosque_switch_B) and vars.bon_bosque_switch_C, [
	fire_event(get_object(level, 'door1'), 'unlock'),
	map(['control_post_door', 'control_post_door_2', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
]),
if(vars.bon_bosque_switch_A and (not vars.bon_bosque_switch_B) and (not vars.bon_bosque_switch_C), [
	map(['control_post_door', 'door2'], 'door_id', fire_event(get_object(level, door_id), 'unlock')),
	map(['control_post_door_2', 'door1'], 'door_id', fire_event(get_object(level, door_id), 'lock'))
]),
end_script()
]"
		target="level.player"
		[/modification]

	[/script]

